import React, {useState, useEffect} from 'react';
import axios from 'axios';
import Key from '../Key';


const Current = () => {
    let [zipCode, setZipCode] = useState(84020); 
    const [data, setData] = useState(null);
    const [error, setError] = useState(null);

    const getData = async () => {
      try {
        const response = await axios.get(
            `http://api.weatherapi.com/v1/current.json?key=${Key}&q=${zipCode}`
        );
        setData(response.data);
        setError(null);
        console.log(data);
      } catch (err) {
        setError(err.message);
        console.log(error);
        setData(null);
      } 
    };

    getData();

    const handleSignUp = (event) => {
      event.preventDefault();
      getData();
    }




  console.log(data);

        return (
          <React.Fragment>
          <div className="zipCode">
          <form onSubmit={handleSignUp}>
          <h3>Zipcode: <input 
                    id="zipCode" 
                    name="zipCode" 
                    type="text" 
                    value={zipCode}
                    onChange={(e) => setZipCode(e.target.value)} /></h3> 
                    <button type="submit">Submit</button> 
          </form>
          </div>

           <div className='currentBox'>
            <h1 className='city'>{data.location.name}</h1>
            <p><img className='icon' src={data.current.condition.icon} alt="weather_icon" /> </p>

            <p>Temperature: {data.current.temp_f} F</p>
            <p>UV Index: {data.current.uv}</p>
            <p>Humidity: {data.current.humidity}%</p>
            <p>Precipitation: {data.current.precip_in} Inches</p>

        </div>

        </React.Fragment>

    );
    }

export default Current;
